import React, { Components } from 'react';
import CompanySquare from './CompanySquare.svg';
import ProductLarge from './ProductLarge.png';
import ProductMiddle from './ProductMiddle.png';
import WallPaper from './WallPaper.jpg';

const imagesDefs = {
  imgCompanySquare: CompanySquare,
  imgProductLarge: ProductLarge,
  imgProductMiddle: ProductMiddle,
  imgWallPaper: WallPaper
}

export default imagesDefs;
